import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'estacionamento';

  (() => {
    const querySelector = document;
    const $ = (q: string): HTMLElement => document.querySelector(q);

    const convertPeriod = (mil: number): string => {
        const min = Math.floor(mil / 60000);
        const sec = Math.floor((mil % 60000) / 1000);
        return `${min}m e ${sec}s`;
    };

    const renderGarage = (): void => {
        const garage = getGarage();
        $("#garage").innerHTML = "";
        garage.forEach((c: { name: string; licence: string; time: string; }) => addCarToGarage(c));
    };

    const addCarToGarage = (car: { name: string; licence: string; time: string; }): void => {
        const row = document.createElement("tr");
        row.innerHTML = `
            <td>${car.name}</td>
            <td>${car.licence}</td>
            <td data-time="${car.time}">
                ${new Date(car.time)
                        .toLocaleString('pt-BR', { 
                            hour: 'numeric', minute: 'numeric' 
                })}
            </td>
            <td>
                <button class="delete">x</button>
            </td>
        `;

        $("#garage").appendChild(row);
    };

    const checkOut = (info: HTMLCollectionOf<HTMLTableDataCellElement>): void => {
        let period = new Date().getTime() - new Date(info[2].dataset.time).getTime();
        period = convertPeriod(period);

        const licence = info[1].textContent;
        const msg = `O veículo ${info[0].textContent} de placa ${licence} permaneceu ${period} estacionado. \n\n Deseja encerrar?`;

        if(!confirm(msg)) return;

        const garage = getGarage().filter((c: { licence: string; }) => c.licence !== licence);
        localStorage.garage = JSON.stringify(garage);

        renderGarage();
    };

    const getGarage = (): { name: string; licence: string; time: string; }[] => localStorage.garage ? JSON.parse(localStorage.garage) : [];

    renderGarage();
    $("#send").addEventListener("click", (e: Event) => {
        const name = ($("#name") as HTMLInputElement).value;
        const licence = ($("#licence") as HTMLInputElement).value;

        if(!name || !licence){
            alert("Os campos são obrigatórios.");
            return;
        }   

        const card = { name, licence, time: new Date().toString() };

        const garage = getGarage();
        garage.push(card);

        localStorage.garage = JSON.stringify(garage);

        addCarToGarage(card);
        ($("#name") as HTMLInputElement).value = "";
        ($("#licence") as HTMLInputElement).value = "";
    });

    $("#garage").addEventListener("click", (e: Event) => {
        if((e.target as HTMLElement).className === "delete")
            checkOut((e.target as HTMLElement).parentElement.parentElement.cells);
    });
})();

}
